import Upper from "./Component/Upper";
import { Routes, Route, Link } from "react-router-dom";


function App() {
  return (
    <div className="App">

<Routes>
        <Route path="/" element={<Countries />} />
        <Route path="about" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
